        <h1>here is about header</h1>
        <ul>
          <li>s {/* <Link to="/">Home</Link> */}</li>
          <li>s {/* <Link to="products">products</Link> */}</li>
        </ul>
      </nav>
    </header>
  );
};

export default NavigateBar;
